import React, {Component} from 'react';
import './FactoryPage.css'

class FactoryPage extends Component {
    render() {
        return (
            <div>
                <div className="container">
                    <p>Xưởng sản xuất đồ gỗ nội thất&nbsp;<strong>HomeGroup</strong>&nbsp;nằm trên diện tích hơn <strong>1500m2</strong> tại Phượng Đồng, Chương Mỹ, Hà Nội. Không như những xưởng gỗ khác trên thị trường, máy móc chủ yếu được nhập từ Trung Quốc hoặc máy cũ từ nước ngoài được nhập về Việt Nam nhưng với HomeGroup trang thiết bị máy móc được nhập khẩu mới hoàn toàn từ <strong>Italia</strong>, dây chuyền tự động hóa.</p>
                </div>
            </div>
        );
    }
}

export default FactoryPage;
